class GasProp:

    def __init__(self):
        self._gas_type = 0
        self._xlambda = None
        self._xminl = 14.66
        self._r = 0.28716

    def air(self, r=0.28716):
        self._gas_type = 0
        self._r = r

    def combustion(self, r=0.28716, xminl=14.66, lamb=None, phi=None):
        self._gas_type = 1
        self._r = r
        self._xminl = xminl
        if lamb is not None:
            self._xlambda = lamb
        if phi is not None:
            self._xlambda = 1 / phi
        if lamb is not None and phi is not None:
            raise Exception(f"Please specify only Phi({phi}) or Lambda({lamb})")
        if lamb is None and phi is None:
            raise Exception(f"Please specify Phi({phi}) or Lambda({lamb})")

    def T(self, h=None, p=None, s=None):
        if h is None and p is None and s is None:
            raise Exception("Please specify h or (p and s)")
        if h is not None and (p is not None or s is not None):
            raise Exception("Please specify only h or (p and s)")
        if h is None and (p is None or s is None):
            raise Exception("Please specify p and s")
        if h is not None:
            if self._gas_type == 0:
                return self._exec(self._gas_type, 1, self._r, h)
            else:
                return self._exec(self._gas_type, 1, self._r, self._xminl, self._xlambda, h)
        else:
            if self._gas_type == 0:
                return self._exec(self._gas_type, 2, self._r, p, s)
            else:
                return self._exec(self._gas_type, 2, self._r, self._xminl, self._xlambda, p, s)

    def h(self, T=None, p=None, s=None):
        if T is None and p is None and s is None:
            raise Exception("Please specify T or (p and s)")
        if T is not None and (p is not None or s is not None):
            raise Exception("Please specify only T or (p and s)")
        if T is None and (p is None or s is None):
            raise Exception("Please specify p and s")
        if T is not None:
            if self._gas_type == 0:
                return self._exec(self._gas_type, 3, self._r, T)
            else:
                return self._exec(self._gas_type, 3, self._r, self._xminl, self._xlambda, T)
        else:
            if self._gas_type == 0:
                return self._exec(self._gas_type, 4, self._r, p, s)
            else:
                return self._exec(self._gas_type, 4, self._r, self._xminl, self._xlambda, p, s)

    def p(self, T=None, h=None, s=None):
        if s is None:
            raise Exception("Please specify (T and s) or (h and s)")
        if T is None and h is None:
            raise Exception("Please specify T or h")
        if T is not None:
            if self._gas_type == 0:
                return self._exec(self._gas_type, 5, self._r, T, s)
            else:
                return self._exec(self._gas_type, 5, self._r, self._xminl, self._xlambda, T, s)
        else:
            if self._gas_type == 0:
                return self._exec(self._gas_type, 6, self._r, h, s)
            else:
                return self._exec(self._gas_type, 6, self._r, self._xminl, self._xlambda, h, s)

    def s(self, T=None, h=None, p=None):
        if p is None:
            raise Exception("Please specify (T and p) or (h and p)")
        if T is None and h is None:
            raise Exception("Please specify T or h")
        if T is not None:
            if self._gas_type == 0:
                return self._exec(self._gas_type, 7, self._r, T, p)
            else:
                return self._exec(self._gas_type, 7, self._r, self._xminl, self._xlambda, T, p)
        else:
            if self._gas_type == 0:
                return self._exec(self._gas_type, 8, self._r, h, p)
            else:
                return self._exec(self._gas_type, 8, self._r, self._xminl, self._xlambda, h, p)

    @staticmethod
    def _exec(*args):
        write_exe()
        output = subprocess.Popen(["./GPexe"] + list(map(str, args)), stdout=subprocess.PIPE).communicate()[0]
        remove_exe()
        output = output.decode()
        if len(output.split()) > 1:
            raise Exception(output)
        else:
            return float(output)


